import React from "react";
import { useNavigate } from "react-router-dom";
import AboutMe from "./Components/AboutMe";

function Home() {
    let navigate = useNavigate();
  return (
    <div className="Home">

    <AboutMe />
      <button onClick={()=>{navigate("/work/JasonClerkID")}}>Jason Clerk ID</button>
      <button onClick={()=>{navigate("/work/SugarFlower")}}>Sugar {"&"} Flower</button>
      <button onClick={()=>{navigate("/work/Canada150")}}>Canada150</button>
      <button onClick={()=>{navigate("/work/McDonaldsGCTA")}}>McDonald's GCTA</button>
    </div>
  );
}

export default Home;
